INSERT INTO `Content` (`Id`, `TopicId`, `Content`, `UserId`, `File`, `Date`) VALUES
	(51, 4, '\n\n\n	\n	\n	\n	&lt;style type=&quot;text&#x2F;css&quot;&gt;p { margin-bottom: 0.25cm; direction: ltr; line-height: 120%; text-align: left; }&lt;&#x2F;style&gt;\n\n\n&lt;p style=&quot;margin-bottom: 0.28cm; line-height: 200%; text-align: justify;&quot;&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;&lt;strong&gt;Communication&lt;&#x2F;strong&gt;&lt;br&gt;&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;&#x2F;p&gt;&lt;p style=&quot;margin-bottom: 0.28cm; line-height: 200%; text-align: justify;&quot;&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;The\nword communication is derived from the Latin word, &lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;&lt;em&gt;communis,\n&lt;&#x2F;em&gt;&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;which\nmeans &lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;&lt;em&gt;common&lt;&#x2F;em&gt;&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;&lt;strong&gt;.\n&lt;&#x2F;strong&gt;&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;Communication\nis concerned with all the ways in which information and ideas are\nexchanged and shared. &lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;Communication\nis the process of transferring information from a sender to a\nreceiver with the use of a medium in which the communicated\ninformation is understood by both sender and receiver. It is a\nprocess that allows organisms to exchange information by several\nmethods. &lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;In\nits simplest form communication is the use of words to describe\nand convey a message or give information to another person. We\ncommunicate using language as a code to share information, ideas\nand feelings.    &lt;&#x2F;font&gt;&lt;&#x2F;font&gt;\n&lt;&#x2F;p&gt;\n&lt;p style=&quot;margin-bottom: 0cm; line-height: 200%; text-align: justify;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;&lt;font color=&quot;#00000a&quot;&gt;\n        &lt;font face=&quot;Calibri, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;The\nword communication has been variously defined by scholars according\nto their persuasion. These arrays of definitions, notwithstanding,\nare pertinent to the affront. Barnard (1938) defined communication\nas‘ the means by which people are linked together in an\norganisation to achieve a common purpose.&quot; To Hoy and Miskel\n(1982) communication refers to the behaviour that conveys the desired\nmeaning of a message to two or more parties to the message. While\nAnderson (1972, p5) defined it as a dynamic process by which an\nindividual, consciously or unconsciously affects the cognitions of\nanother through materials or agencies used in symbolic ways.\nCommunication, as Kimbrough and Nunnery (1988) posited, may be\n“regulative” characterised by task - related may directions and\nfeedback between superiors and subordinates. Communication can also\nbe conceived of as “Innovative” dealing with means and ends of\nbringing about change&quot;. &lt;br&gt;&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;&#x2F;p&gt;&lt;p style=&quot;margin-bottom: 0cm; line-height: 200%; text-align: center;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;&lt;font color=&quot;#00000a&quot;&gt;&lt;font face=&quot;Calibri, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;img src=&quot;data:image&#x2F;png;base64,iVBORw0KGgoAAAANSUhEUgAAAOcAAADaCAIAAADScsIEAAD1NElEQVR4nNz9B4BkV3UnDt+X36vY1bl7ch7NSBrlhGQhQAIEGDDZAoMBB8IuYdc29nrtNWD&#x2F;7V3sxV5jFhOM7QW8iJxBQqAAEspxcu4cK78cvt+9p+pNdZzpkbz7eS9Dq7q66r377j33nN&#x2F;JapK4jI84&#x2F;&#x2F;zLVOP41jGL5KUBL6kqSFTQvHxhD9lkj6sJmsL1qp1+Tjy7axuMjtmCp8A9i&#x2F;KsLLvZ3RVYZHBf09YJDFFDRUVt9ZoQ8SQZU4YmIAq9jQRk407fjLHc13H1w1D101JMSQ1UhQN35ydm9Cz+WzRYmE8O19+5OGH7&#x2F;nJT08cO&#x2F;knf&#x2F;Inqi4r2LxEdiTJSwIpxNPLtabtgVAadtOudh850r9+vaQwQ+ydlD4Q7igRpa55U1tfiEG9fPWJXmP+bFjY1sNgGdOrhzFflkRmUZTgWIlbswW7xN+J06utMrB8RKamaeI1CBc&#x2F;8SvIwnEc&#x2F;IpzGwQBXoBYU8J9toOIAc8WhSwOGHYWrMJlnszcOAlkP2GxwtQgSvQg5s8p08mOZMus12q5Qj7mlKx3Lt6il8sO3NA0+bdAOq7tGKaGw898X9X1M1+V2h&#x2F;FPZPgzJcTWZJiKeELq+oZ1&#x2F;dM3WLNgOkaPU5O1wMWyLR7Mm2KhLUMWByCoE0LC4tV5QdGlsMwVMVhZGKj6Z7EmFi95jSbnusx08rHQVhvuGFie0ESG12na7EzMRcFoakZfbuvfuXWyyRJOV1varGGWUUxcwLVCf0oBDuTAzcqGhnsHdZtfHo25vyO30yh+53ZSlm8J7NzZrS0StVyI2ZyuVyWkh4&#x2F;DCPOSWWQCDgfExwC&#x2F;xRONXiXxRLzEgknOWdaSeR3d+XxR40Id&#x2F;FoEe7Z9lLyPA&#x2F;slthAvV7HrU+cOEE0umnTpu7u7lqtZvDDr5&#x2F;7c51l+OBu2HKViw&#x2F;FYVI2yjKfeTELdE4IvRbYAlhdhk&#x2F;JdQLTBLvhBzRf6MIa2M1GJptjjC3gE+mjrvDMxIsjP9RxXxChrGp4wenKU6SYSQuIh79KiDOl&#x2F;CkW4k&#x2F;ymQxKMiEO5JZMbTb9SE9CSG0pTqLEAleTQM2Kwr+ryGLdQLKszcWx1GqbblJu1xKsmQyOZUlWjMH1GxUl03R8EGEzZK6suVHigX5Dzt6CIHJs1wujbBdOkxzEMV57ge8FYQBmEMmJzjAnz53U9awbxJpigEXEQaJjWkl7QYjdts7P2kapJDZAZoWCGfIjzh8glfdS0v4Zt6gWHAAyAFgk9HWsD5YgFtJLkF284m2WG7SUqdBvNBo4PLOzs5dffjnhhOPHjz&#x2F;wwAP79u0rFArPDa+VWK3mF7r1RC46fi3w3GI+mzAwVRByteHXGvO2X08MP5uz8vmunJnNKGCKMhdF5flKf09XEEb5bEFcK31Yfj4T1qLXlQ4qdrvZbBYLWbw2TJMeBmRgAma1ZFzHVxNxS6wvaFcS&#x2F;1oELQOPqkBNnOFzZlGfre