Okwo (1995) supports Thompson’s\n(1979) opinion that communication is “an interactive process\ninvolving the design of ideas, messages, information or data and\ntheir dissemination in an attempt to effect a change in a person’s\nbehaviour or to persuade him to act in a particular or predetermined\nmanner” communication may take place between individuals or\norganizations and that process modifies the behaviour of both the\nsender and the receiver  &lt;&#x2F;font&gt;&lt;&#x2F;font&gt;\n&lt;&#x2F;p&gt;\n&lt;p style=&quot;margin-bottom: 0cm; line-height: 200%; text-align: justify;&quot;&gt;\n&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;Communication&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;can\ncan be defined as the process of transmitting information and common\nunderstanding from one person to another (Keyton, 2011).\nCommunication is the given of understandable information or message\nand the receiving and understanding involve to the point that the\nreceiver is able to respond by appropriate action or inaction.\nCommunication is the means by which we share our reality with others,\nit is the mechanism through which human relation exist and develop. \nIt is the process by which an individual that is the communicator\ntransmit stimuli usually verbal symbols to modify the behavior of the\nother individual that is the receiver. Also it is the process which\ninvolves the transmission of properly conceived and encoded facts,\nideas, views, thought, opinions, messages, feelings, or information\namong individuals organizations or systems via appropriate means such\nas face to face conversation, letters, reports, memoranda, drawings,\ndesigns, posters, telephone calls, e-mails, minutes of meetings\ninvoices, photography, symbols, models etc.    &lt;&#x2F;font&gt;&lt;&#x2F;font&gt;\n&lt;&#x2F;p&gt;\n\n&lt;p style=&quot;margin-bottom: 0cm; line-height: 200%; text-align: left;&quot;&gt;&lt;br&gt;&lt;font color=&quot;#000000&quot;&gt;&lt;font color=&quot;#00000a&quot;&gt;&lt;font face=&quot;Calibri, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;&#x2F;font&gt;\n&lt;&#x2F;p&gt;\n\n', 17, '.mp3', '2018-11-05'),
	(52, 5, '\n\n\n	\n	\n	\n	&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;style type=&quot;text&#x2F;css&quot;&gt;p { margin-bottom: 0.25cm; direction: ltr; line-height: 120%; text-align: left; }&lt;&#x2F;style&gt;&lt;&#x2F;p&gt;\n\n\n&lt;p style=&quot;margin-bottom: 0.28cm; line-height: 200%; text-align: justify;&quot;&gt;&lt;font color=&quot;#00000a&quot;&gt;\n&lt;font face=&quot;Times New Roman, serif&quot;&gt;Okwo (1995) supports Thompson’s\n(1979) opinion that communication is “an interactive process\ninvolving the design of ideas, messages, information or data and\ntheir dissemination in an attempt to effect a change in a person’s\nbehaviour or to persuade him to act in a particular or predetermined\nmanner” communication may take place between individuals or\norganizations and that process modifies the behaviour of both the\nsender and the receiver  &lt;&#x2F;font&gt;&lt;&#x2F;font&gt;\n&lt;&#x2F;p&gt;\n&lt;p style=&quot;margin-bottom: 0cm; line-height: 200%; text-align: justify;&quot;&gt;\n&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;Communication &lt;&#x2F;font&gt;&lt;&#x2F;font&gt;&lt;font face=&quot;Times New Roman, serif&quot;&gt;&lt;font style=&quot;font-size: 12pt&quot; size=&quot;3&quot;&gt;can\ncan be defined as the process of transmitting information and common\nunderstanding from one person to another (Keyton, 2011).\nCommunication is the given of understandable information or message\nand the receiving and understanding involve to the point that the\nreceiver is able to respond by appropriate action or inaction.\nCommunication is the means by which we share our reality with others,\nit is the mechanism through which human relation exist and develop. \nIt is the process by which an individual that is the communicator\ntransmit stimuli usually verbal symbols to modify the behavior of the\nother individual that is the receiver. Also it is the process which\ninvolves the transmission of properly conceived and encoded facts,\nideas, views, thought, opinions, messages, feelings, or information\namong individuals organizations or systems via appropriate means such\nas face to face conversation, letters, reports, memoranda, drawings,\ndesigns, posters, telephone calls, e-mails, minutes of meetings\ninvoices, photography, symbols, models etc.    &lt;&#x2F;font&gt;&lt;&#x2F;font&gt;\n&lt;&#x2F;p&gt;\n\n', 17, '.docx', '2018-11-05');
